import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import About from './About';



const App = () => {

  return (
    <>
    
        <Routes >

          {(() => {
            <Route path="/a" element={<About/>}></Route>
          })}

        </Routes>
      
      {/* <About/>
        <Contact/>  */}
    </>
  )
}

export default App;
